import React from "react";
import axios from "axios";
import UploadCSV from "../components/Modal";
import firebase from "../common/firebase";

const posts = [
  { path: "nba", title: "Naive Bayes algorithm" },
  { path: "lra", title: "Logistic Regression algorithm" },
  { path: "svm", title: "Support Vector Machine algorithm" },
  { path: "bag", title: "Bagging algorithm" },
  { path: "clus", title: "Clustering algorithm" },
  { path: "tree", title: "Decision tree algorithm" }
];
import Layout from "../components/layout";

var backend_url = "";

export default class extends React.Component {

  static async getInitialProps({query, res}) {
    const post = posts.find(post=> post.path == query.path);
    console.log(post)
    return {post}
  }

  constructor(props) {
    super(props);

    // alert("ctor : " + this.props.location);

    this.handleSubmit = this.handleSubmit.bind(this);
    this.state = {
      imgSrc: "",
      url: "",
      isImageReady: false,
      sos: "",
      lambda: "",
      maxit: "",
      depthlimit: "",
      exlimit: "",
      k: ""
    };
    this.path = "";
  }

  onChange(event) {
    console.log(event.target.name);
    var param = event.target.name;
    this.setState({ [event.target.name]: event.target.value });
  }

  handleSubmit(filename) {
    console.log("handling submit");
    var formData = new FormData();
    // console.log(this.fileInput.current.files[0]);
    formData.append("file", filename);
    var div = document.getElementById("image-display");
    div.innerHTML =
      "<Spinner animation='border' role='status'> <span className='sr-only'>Loading...</span></Spinner>";
    if (this.path == "nba") {
      backend_url = "http://localhost:8000/dataMining/NaiveBayes/";
    } else if (this.path == "lra") {
      backend_url = "http://localhost:8000/dataMining/LogisticRegression/";
      backend_url =
        backend_url +
        this.state.sos +
        "/" +
        this.state.lambda +
        "/" +
        this.state.maxit;
      console.log(backend_url);
    } else if (this.path == "svm") {
      backend_url = "http://localhost:8000/dataMining/SVM/";
      backend_url =
        backend_url +
        this.state.sos +
        "/" +
        this.state.lambda +
        "/" +
        this.state.maxit;
      console.log(backend_url);
    } else if (this.path == "bag") {
      backend_url = "http://localhost:8000/dataMining/Bagging/";
      backend_url =
        backend_url + this.state.depthlimit + "/" + this.state.exlimit;
      console.log(backend_url);
    } else if (this.path == "clus") {
      backend_url = "http://localhost:8000/dataMining/Clustering/";
      backend_url = backend_url + this.state.k;
      console.log(backend_url);
    } else if (this.path == "tree") {
      backend_url = "http://localhost:8000/dataMining/DecisionTree/";
      backend_url =
        backend_url + this.state.depthlimit + "/" + this.state.exlimit;
      console.log(backend_url);
    }
    axios
      .post(backend_url, formData, {
        headers: {
          "Content-Type": "multipart/form-data"
        }
      })
      .then(e => {
        // console.log(e);

        var div = document.getElementById("image-display");
        div.innerText = "";
        var imageOupput = "data:image/png;base64," + e.data;
        this.setState({ 
          imgSrc: imageOupput,
          isImageReady: true,
        });

      })
      .catch(err => {
        console.log(err);

        var div = document.getElementById("image-display");
        div.innerText = "Please check your input and parameters";
      });
  }

  handleUpload = () => {
    const { imgSrc } = this.state;

    let message = this.state.imgSrc.substring(22);
    const storage = firebase.storage().ref();

    const uploadTastk = firebase.storage().ref().child('image.png').putString(message, 'base64', {contentType:'image/png'})
    uploadTastk.then(
        ( response ) => {
            console.log('image upload success')
        },
        ( failedReason ) => {
            console.log('image upload failed')
        }
    )

  };

  render() {
    // console.log(this.props.path);
    // this.path = this.props.url.asPath.substring(8);
    // const post = posts.find(p => p.path == this.path);
    const {post} =this.props
    // console.log(post)
    this.path = post.path;
    if (this.path == "nba") {
      return (
        <>
          <h1>{post.title}</h1>
          <hr></hr>
          <div className="row">
            <div className="col-6">
              <UploadCSV onSubmit={this.handleSubmit}></UploadCSV>
            </div>
            <div className="col-6">
              { this.state.isImageReady ? 
                ( <>
                    <div className="text-right">
                      <button className="btn btn-secondary btn-sm" onClick={ this.handleUpload } > Save </button>
                    </div>
                  </>
                ) : ( <>
                      </> 
                    )
              }
              <div id="image-display"></div>
              <img id="image-output" src={this.state.imgSrc}></img>
            </div>
          </div>
        </>
      );
    } else if (this.path == "lra") {
      return (
        <>
          <h1>{post.title}</h1>
          <hr></hr>
          <div className="row">
            <div className="col-6">
              <form>
                <div className="form-group row">
                  <label className="col-sm-2 col-form-label"> Size of Step: </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="1,2,3"
                      type="text"
                      name="sos"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                  <label className="col-sm-2 col-form-label"> Lambda: </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="1,2,3"
                      type="text"
                      name="lambda"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                  <br />
                  <br />
                  <label className="col-sm-2 col-form-label">
                    {" "}
                    Number of Max iteration:{" "}
                  </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="1,2,3"
                      type="text"
                      name="maxit"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                </div>
                <UploadCSV onSubmit={this.handleSubmit}></UploadCSV>
              </form>
            </div>
            <div className="col-6">
              { this.state.isImageReady ? 
                ( <>
                    <div className="text-right">
                      <button className="btn btn-secondary btn-sm" onClick={ this.handleUpload } > Save </button>
                    </div>
                  </>
                ) : ( <>
                      </> 
                    )
              }
              <div id="image-display"></div>
              <img id="image-output" src={this.state.imgSrc}></img>
            </div>
          </div>
        </>
      );
    } else if (this.path == "svm") {
      return (
        <>
          <h1>{post.title}</h1>
          <hr></hr>
          <div className="row">
            <div className="col-6">
              <form>
                <div className="form-group row">
                  <label className="col-sm-2 col-form-label"> Size of Step: </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="1,2,3"
                      type="text"
                      name="sos"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                  <label className="col-sm-2 col-form-label"> Lambda: </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="1,2,3"
                      type="text"
                      name="lambda"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                  <br />
                  <br />
                  <label className="col-sm-2 col-form-label">
                    {" "}
                    Number of Max iteration:{" "}
                  </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="1,2,3"
                      type="text"
                      name="maxit"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                </div>
                <UploadCSV onSubmit={this.handleSubmit}></UploadCSV>
              </form>
            </div>
            <div className="col-6">
              { this.state.isImageReady ? 
                ( <>
                    <div className="text-right">
                      <button className="btn btn-secondary btn-sm" onClick={ this.handleUpload } > Save </button>
                    </div>
                  </>
                ) : ( <>
                      </> 
                    )
              }
              <div id="image-display"></div>
              <img id="image-output" src={this.state.imgSrc}></img>
            </div>
          </div>
        </>
      );
      // List the params of each on of them
    } else if (this.path == "bag") {
      return (
        <>
          <h1>{post.title}</h1>
          <hr></hr>
          <div className="row">
            <div className="col-6">
              <form>
                <div className="form-group row">
                  <label className="col-sm-2 col-form-label"> Depth limit: </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="3"
                      type="text"
                      name="depthlimit"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                  <label className="col-sm-2 col-form-label">
                    {" "}
                    Example Limit:{" "}
                  </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="3"
                      type="text"
                      name="exlimit"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                </div>
                <UploadCSV onSubmit={this.handleSubmit}></UploadCSV>
              </form>
            </div>
            <div className="col-6">
              { this.state.isImageReady ? 
                ( <>
                    <div className="text-right">
                      <button className="btn btn-secondary btn-sm" onClick={ this.handleUpload } > Save </button>
                    </div>
                  </>
                ) : ( <>
                      </> 
                    )
              }
              <div id="image-display"></div>
              <img id="image-output" src={this.state.imgSrc}></img>
            </div>
          </div>
        </>
      );
    } else if (this.path == "clus") {
      return (
        <>
          <h1>{post.title}</h1>
          <hr></hr>
          <div className="row">
            <div className="col-6">
              <form>
                <div className="form-group row">
                  <label className="col-sm-2 col-form-label">
                    {" "}
                    Number of Cluster:{" "}
                  </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="3"
                      type="text"
                      name="k"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                </div>
                <UploadCSV onSubmit={this.handleSubmit}></UploadCSV>
              </form>
            </div>
            <div className="col-6">
              { this.state.isImageReady ? 
                ( <>
                    <div className="text-right">
                      <button className="btn btn-secondary btn-sm" onClick={ this.handleUpload } > Save </button>
                    </div>
                  </>
                ) : ( <>
                      </> 
                    )
              }
              <div id="image-display"></div>
              <img id="image-output" src={this.state.imgSrc}></img>
            </div>
          </div>
        </>
      );
    } else if (this.path == "tree") {
      return (
        <>
          <h1>{post.title}</h1>
          <hr></hr>
          <div className="row">
            <div className="col-6">
              <form>
                <div className="form-group row">
                  <label className="col-sm-2 col-form-label"> Depth limit: </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="3"
                      type="text"
                      name="depthlimit"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                  <label className="col-sm-2 col-form-label">
                    {" "}
                    Example Limit:{" "}
                  </label>
                  <div className="col-sm-10">
                    <input
                      className="form-control"
                      placeholder="3"
                      type="text"
                      name="exlimit"
                      onChange={this.onChange.bind(this)}
                    />
                  </div>
                </div>
                <UploadCSV onSubmit={this.handleSubmit}></UploadCSV>
              </form>
            </div>
            <div className="col-6">
              { this.state.isImageReady ? 
                ( <>
                    <div className="text-right">
                      <button className="btn btn-secondary btn-sm" onClick={ this.handleUpload } > Save </button>
                    </div>
                  </>
                ) : ( <>
                      </> 
                    )
              }
              <div id="image-display"></div>
              <img id="image-output" src={this.state.imgSrc}></img>
            </div>
          </div>
        </>
      );
    }
    return (
      <>
        <h1>{post.title}</h1>
        <hr></hr>
        <div className="row">
          <div className="col-6">
            <UploadCSV onSubmit={this.handleSubmit}></UploadCSV>
          </div>
          <div className="col-6">
            { this.state.isImageReady ? 
              ( <>
                  <div className="text-right">
                    <button className="btn btn-secondary btn-sm" onClick={ this.handleUpload } > Save </button>
                  </div>
                </>
              ) : ( <>
                    </> 
                  )
            }
            <div id="image-display"></div>
            <img id="image-output" src={this.state.imgSrc}></img>
          </div>
        </div>
      </>
    );
  }
}
